tuv.seg:
- drag and drop files on this pane;
	- use Project > Add Files...;
	- use Project > Source Files... and click on Add Files...;
	- use your file manager to copy files to the 'source' folder,
	  and then use Project > Reload to reload the project.

- przeciągnij i upuść pliki w tym okienku;
	- wybierz Projekt > Dodaj pliki...;
	- wybierz Projekt > Pliki źródłowe... i kliknij Dodaj pliki...;
	- użyj menedżera plików, aby skopiować pliki do folderu 'źródłowego',
	  następnie wybierz Projekt > Odśwież, aby załadować ponownie projekt.

Use "java -Xmx<size-in-MB>M -jar OmegaT.jar" from the command 
line or in the OmegaT start script;
The current setting is {0}MB;

